response.about:
Принимаем заявки на расчет туров зарубеж!

С нашей помощью вы можете ознакомиться как с уже существующими туристическими предложениями, так и организовать свой собственный индивидуальный отдых. 

Для этого достаточно всего лишь отправить заявку с вашими пожеланиями в личное сообщение или на почту tanya-globus@mail.ru. 
В заявке необходимо указать:
1)предположительные даты тура;
2)вид отдыха (экскурсионный, пляжный, лечебный, обучающий и тд.) или же конкретно интересующее место;
3)размещение;
4)категорию отеля;
5)отель (если знаете).

По всем интересующим вопросам можно обращаться к Татьяне, тел. 211 820
